#include <iostream>
using namespace std;

void fill(int** arr, int n) {
	for (int i = 0; i < n; ++i) {
		for (int j = 0; j < n; ++j) {
			if (arr[i][j] == 0) {
				arr[i][j] = -1;
			}
		}
	}
}

bool check(int** arr, int x, int y, int num, int n) {
	// check row and column
	for (int i = 0; i < n; ++i) {
		if ((arr[x][i] == num && i!= y) || (arr[i][y] == num && i!= x)) {
			return false;
		}
	}

	// check square
	int startX = x / 3 * 3;
	int startY = y / 3 * 3;
	for (int i = startX; i < startX + 3; ++i) {
		for (int j = startY; j < startY + 3; ++j) {
			if (arr[i][j] == num &&!(i == x && j == y)) {
				return false;
			}
		}
	}

	return true;
}

bool dfs(int** arr, int n) {
	for (int i = 0; i < n; ++i) {
		for (int j = 0; j < n; ++j) {
			if (arr[i][j] == 0) {
				for (int k = 1; k <= n; ++k) {
					if (check(arr, i, j, k, n)) {
						arr[i][j] = k;
						if (dfs(arr, n)) return true;
						arr[i][j] = 0; // backtracking
					}
				}
				return false;
			}
		}
	}

	return true;
}

void printArr(int** arr, int n) {
	for (int i = 0; i < n; ++i) {
		for (int j = 0; j < n; ++j) {
			cout << arr[i][j] << " ";
		}
		cout << endl;
	}
}

int main() {
	int n;
	cin >> n;

	int** arr = new int* [n];
	for (int i = 0; i < n; ++i) {
		arr[i] = new int[n];
		for (int j = 0; j < n; ++j) {
			cin >> arr[i][j];
		}
	}

	fill(arr, n);
	dfs(arr, n);
	printArr(arr, n);

	return 0;
}
